// Importa las bibliotecas necesarias
import React from 'react';
import { Routes, Route, Navigate, BrowserRouter } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';

// Importa tus componentes de página
import PetPage from './pages/pet/Page/PagePet';
import CreatePetPage from './pages/pet/CreatePage/CreatePagePet';
import DetailPetPage from './pages/pet/DetailPage/DetailPagePet';
import RegisterUserPage from './pages/user/Page/PageUser';

// Componente para proteger rutas
const ProtectedRoute = ({ element, ...props }) => {
  const { isAuthenticated } = useAuth();

  // Verifica la autenticación
  return isAuthenticated ? (
    <Route {...props} element={element} />
  ) : (
    <Navigate to="/login" replace={true} />
  );
};

// Componente principal de la aplicación
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <AuthProvider>
          <Routes>
            <Route path="/" element={<RegisterUserPage />} />
            <ProtectedRoute path="/pets" element={<PetPage />} />
            <ProtectedRoute path="/pets/addPet" element={<CreatePetPage />} />
            <ProtectedRoute path="/pets/detailPet/:idPet" element={<DetailPetPage />} />
          </Routes>
        </AuthProvider>
      </BrowserRouter>
    </div>
  );
}

export default App;
